const MessagesList = ({messages}) => {
    return (
        <div>
            {messages.sort(({ id: current }, { id: previous }) => previous - current).map((m) => (
                <div key={m.id} className="single">
                    <div>{m.text}</div>
                </div>
            ))}
        </div>
    )
}

export default MessagesList
